// frontend/src/components/Navbar.js
import React from 'react';
import logo from '../assets/logo.svg';  // Add your logo image here

const Navbar = () => {
  return (
    <nav className="navbar">
      <img src={logo} alt="Renter Insights" style={{ width: '150px' }} />
      <ul className="nav-links">
        <li><a href="#reviews">Reviews</a></li>
        <li><a href="#insights">Insights</a></li>
        <li><a href="#homes">Nearby Homes</a></li>
      </ul>
      <input type="text" className="search-bar" placeholder="Search in site" />
    </nav>
  );
};

export default Navbar;
